import { Injectable } from '@angular/core';
import { HttpClient, HttpHeaders, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';
import { Sddiagnostic } from 'src/app/models/Sddiagnostic';

@Injectable({
  providedIn: 'root'
})
export class SddiagnosticService {
  private api = 'https://localhost:7129/api/SDiagnostic';

  constructor(private http: HttpClient) {}

  createSdiagnostics(sddiagnostic: Sddiagnostic): Observable<any> {
    // Log the request being made
    console.log('Creating SD Diagnostic with data:', sddiagnostic);

    const headers = new HttpHeaders({
      'Content-Type': 'application/json'
    });

    return this.http.post(this.api, sddiagnostic, { headers, observe: 'response' });
  }
 

